                    "sub_categories_json": "[\n  {\n    \"college\": {\n      \"id\": \"CLG00001\",\n      \"name\": \"AI\"\n    },\n    \"channel\": {\n      \"id\": \"CHN00002\",\n      \"name\": \"AI Biz. Implementation\"\n    }\n  }\n]",
                    "card_name": "AI를 현장에 적용하는 과정의 우여곡절",
                    "cube_state_update_date": "1586132069159",
                    "description": "전통산업에서도 AI솔루션을 Biz에 적용하며 성공하는 케이스가 점차 증가하고 있습니다.하지만 남들의 성공 사례가 우리에게도 반드시 똑같이 적용되는 것은 아닙니다. 타산지석으로 삼기 위해서는 우리만의 특수성을 고려해야 합니다. 자칫 잘못하면 귤화위지(귤이 해수를 건너 탱자가 된다.)가 될 수 있기 때문입니다. 이를 지양하기 위해서는 우리의 시행착오와 고민을 함께 이야기하며 나눠야 어떤 문제가 예상될 수 있고, 이를 극복할 수 있는 우리만의 방법도 찾을 수 있을 것입니다.본 과정은 AI 솔루션 도입 과정에 있어 현장의 어려움과 경험에 대한 각자의 생각을 나누면서 얘기하는 방식으로 진행됩니다. 오프라인 공간에 모여 서로 얼굴을 보며 생각을 나누면 좋지만, 코로나 19로 인해 zoom을 이용한 Live 형식(60분)으로 진행됩니다.<안내사항>1. 본 과정은 \"Industrial AI솔루션 동향과 도입방안\" 코스(약 40분)를 이수한 경우에만 참가할 수 있습니다.(AI College>AI Biz.Impementation> 상기명의 학습카드 선택) 2. 토론이 원활히 진행될 수 있도록 신청자 중 7명이 참여해 Zoom을 활용한 Live 형태로 진행될 예정입니다.3. 진행계획과 준비사항 등은 신청자 중 확정된 분들께 메일로 개별 안내를 드릴 예정입니다.4. 온라인 세션 일정은 4/28(화) 오후 2시이며, 신청자가 많을 시 추가 일정은 향후 재공지할 예정입니다.5. 다음과 같은 주제로 논의할 예정입니다.<주요 내용>1. \"Industrial AI솔루션 동향과 도입방안\" 과정에 대해 학습하면서 궁금한 점2. AI를 업무에 적용하는 데 있어 가장 큰 걸림돌은 무엇이고, 이를 극복하기 위한 대안은?3. 현재 근무하는 회사, 직무, 산업과 관련해서 AI가 적용되면 큰 도움이 될 만한 것은 무엇이고 왜 그렇게 생각하는가?※ 참여자는 위 내용에 대해 A4용지 1매 이내 사전제출 필요",
