                    "card_name": "[꼼꼼한 논문 읽기] ResNet (잔류학습, 이미지 분류)",
                    "cube_state_update_date": "1604025210725",
                    "description": "[Deep Residual Learning for Image Recognition]본 영상의 논문 리뷰는 ResNet입니다. ResNet은 나온 지 5년이 되었으나 최근까지도 많은 논문에서 베이스라인 아키텍처로 비교되고 있을 정도의 우수한 논문입니다. (2020년 기준 인용 수는 약 60,000회) 본 논문은 CVPR 2016에서 최우수 논문상을 받았고, 2015년 메이저급 이미지 분류 대회들에서 1등 상을 싹쓸이한 논문이기도 합니다.이 논문은 수학적인 개념은 많이 없고 이해하기가 쉽다는 장점이 있습니다.잔여 학습(residual learning) 개념을 이용하여 모델의 최적화 난이도를 낮추어 아주 깊은 네트워크를 이용해도 학습이 잘 이루어질 수 있도록 한다는 점이 특징입니다. 해당 강의는 논문 요약, 논문 리딩 뿐만 아니라 총 3개의 코드 실습을 포함하고 있습니다. (바로 실행 가능한 Colab 코드를 제공합니다.) * ResNet을 이용해 MNIST 학습하기/평가하기: 5분 만에 99.5% test accuracy 만들어 보기* ResNet을 이용해 CIFAR-10 학습하기/평가하기 (95% 이상 test accuracy)* (ImageNet) Pre-trained ResNet을 이용해 이미지 분류해보기",
