                    "description": "# 창의적 BM 디자인  # 프로세스 실습과 체험   # 2day 워크샵 집합 과정   Deep Change 및 고객 중심 BM 혁신을 위해 \"디자인 사고\"의 필요성이 그 어느때 보다 강조되고 있습니다. 디자인씽킹 Dive 워크샵에 참여하시면, 고객을 보다 잘 이해하고 고객 관점의 창의적 솔루션을 도출해가는 과정을 경험해보실 수 있습니다. / 온라인을 통해 학습하신 디자인씽킹 방법론을 실습을 통해 여러분 개인의 역량으로 내재화 할 수 있게 도와드립니다./ 여러분의 실제 업무에 디자인씽킹 방법론을 적용할 때 도움이 될 핵심 노하우와 팁을 터득하실 수 있습니다. Day 11) Recap Design Thinking : 디자인씽킹 프로세스와 방법론을 개괄합니다.2) Design Research (Empathize) : 디자인 리서치를 통한 혁신의 단서를 수집합니다.Day 23) Needs & Insight Capturing (Analyze) : 의미있는 고객 Needs와 핵심 Insight를 발굴합니다.4) Solutioning (Create) : 창의적인 비즈니스/서비스 아이디어와 컨셉을 도출하고 프로토타이핑을 통해 공유합니다.※ 본 과정은 유료 과정으로 수강 확정 과정에서 반려 될 수 있습니다. (수강 신청기간 이후 사별 HR에서 일괄 승인 예정이며, 수강 프로세스는 각사의 정책에 따라 상이할 수 있습니다.)※ 수강 확정 여부는 5월 중 개별 안내 드릴 예정입니다. ※ 과정시행일은 코로나 19 추이에 따라 연기될 수 있으며, 변동 시 수강 확정되신 분들에게 우선 수강의 기회를 드릴 예정입니다. ",
