                    "description": "# 진짜 Needs 찾기   # Insight 실습   # 1day 워크샵 집합 과정   고객의 다양한 목소리 속에 숨겨진 Needs를 발견하여 Insight를 발굴하는 방법을 익히고,이를 통해 새로운 관점으로 문제를 정의하고 Biz. 기회로 구체화 할 수 있도록 하는 방법을 학습합니다.A안 : Affinity Diagram로 숨겨진 Needs 발견하기 (B2C/B2B)1) 고객관점에서 정보 Grouping하기 : 고객 Needs와 가치를 이해합니다.2) Social Data Tool 활용, Affinity Diagram으로 고객 Needs 발견하기 : 분석을 통해 고객 Insight를 발굴합니다.3) Double Bubbling으로 문제정의 하기 : 무엇이 해결해야 할 문제인지 목표를 도출하고 Biz 기회를 찾습니다.B안 : 다면리서치로 시장 기회 발견하기 (B2B)1) 고객가치로 나의 업종과 연관 업종 정의하기 : Market Dynamics와 고객 Needs를 이해합니다.2) T.E.X.T로 시장 속 고객 Needs 발견하기 : 다면 조사로 고객 Needs를 발견합니다.3) 고객 Needs로 문제정의 하기 : 무엇이 해결해야 할 문제인지 목표를 도출하고 Biz 기회를 찾습니다.※ 수강 확정 이후 학습자 프로파일에 따라 A, B안 중 적합한 프로그램으로 진행 될 예정입니다.※ 본 과정은 유료 과정으로 수강 확정 과정에서 반려 될 수 있습니다. (수강 신청기간 이후 사별 HR에서 일괄 승인 예정이며, 수강 프로세스는 각사의 정책에 따라 상이할 수 있습니다.)※ 수강 확정 여부는 5월 중 개별 안내 드릴 예정입니다. ※ 과정시행일은 COVID-19 추이에 따라 연기될 수 있으며, 변동 시 수강 확정되신 분들에게 우선 수강의 기회를 드릴 예정입니다. ",
