                    "cube_state_update_date": "1585682355157",
                    "description": "SK그룹의 애자일 변화 촉진자(Change Agent) 역할을 할 애자일 코치 양성 과정으로, 각 기수별 30명이 선발되어 8주, 총 58시간 동안 강의, 실습, 토론을 통해 다양한 실험을 체험하고, 실제 생활과 업무에 무엇을 적용 시킬지 스스로/함께 결정하게 됩니다.1주차는 2일 workshop, 2/4주차는 텔레코칭, 3/5/6/7/8주차는 1일 workshop으로 구성되어 있습니다.- Managing Yourself : 어떻게 듣고, 어떻게 말하고, 어떻게 이해할 것인가- Team Management : 성장하는 팀을 만들기 위한 실천법- Product Management : 제품, 학습으로의 관점 전환 - SCRUM1011차수는 6/2(화)~3(수), 6/16(화), 6/30(화), 7/7(화), 7/21(화), 7/28(화) Full day Workshop으로 진행되며,6월 2주차와 4주차에는 텔레코칭이 있을 예정입니다.과정 참여를 희망하시는 구성원께서는 우측 <수강신청> 버튼을 누르시고 신청하신 후,하단에 첨부한 과정 신청 안내를 다운받아 내용을 확인하시고 온라인 신청서를 추가 작성해주세요.※ 본 과정은 유료 과정으로 수강 확정 과정에서 반려 될 수 있습니다. (수강 신청기간 이후 사별 HR에서 일괄 승인 예정이며, 수강 프로세스는 각사의 정책에 따라 상이할 수 있습니다.)※ 수강 확정 여부는 5월 중 개별 안내 드릴 예정입니다. ※ 과정시행일은 코로나 19 추이에 따라 연기될 수 있으며, 변동 시 수강 확정되신 분들에게 우선 수강의 기회를 드릴 예정입니다. ",
