                    "description": "※ 내일부터 진행되는 mySUNI 시스템 점검과 상관없이 Live 학습은 진행됩니다. 접속 링크와 비번을 담은 안내 메일을 11/20(금) 오전 10시까지 보내드리겠습니다!!! 알쓸신잡 정재승 교수와 함께 하는 Tech & Biz Talk! 11월에 열리는 Talk에는 김성훈 UPSTAGE 대표(홍콩과기대 교수, 전 네이버 클로바 AI 헤드)를 초대했습니다. 김성훈 대표는 3년간의 네이버 AI 헤드 역할을 끝내시고 인공지능 스타트업 ‘UPSTAGE’를 창업하신 이후 업계의 스폿라이트를 받고 계신 분입니다. 창업 이후 국내외의 AI 분야별 실력자들이 계속해서 합류하고 있어 더 많은 주목을 받고 있습니다.이번 Live 강연은 1) 인공지능의 최근 기술 동향 및 핵심 포인트를 알아보고, 2) 비지니스 중심에서 AI에 접근했던 기존 사례들을 살펴본 후, 3) AI를 중심으로 비즈니스에 접근하는 최근의 사례들을 공유하는 자리로 준비하고 있습니다.기존과 다른 점이 있다면, 인공지능에 대한 기본적인 이해를 갖추신 분들을 청중으로 상정하여 강연을 준비하고 있어서 초심자들에게는 어려운 내용이 제법 등장할 것이라 예상됩니다. 학습 신청할 때 참고하시기 바랍니다.11월 20일(금) 오후 4시부터 시작합니다!!| 주요 발표 내용 - 인공지능의 최근 기술 동향 및 핵심 포인트- 비지니스 중심에서 AI를 보다 (사례)- AI를 중심으로 비즈니스를 보다 (사례) | 김성훈 대표 주요 약력- 현 UPSTAGE 대표 - 현 홍콩과기대 교수- 전 네이버 클로바 AI 헤드-유튜브 강좌 ‘모두를 위한 딥러닝’ 운영",
