                    "cube_state_update_date": "1590543954597",
                    "description": "* 강의 개요  - 디지털 비즈니스의 새로운 한계 비용 곡선을 이해하고, 이를 통해 왜 고객 공감이 중요하고 필요한지를 설명하고 있습니다. - 고객 공감을 가능하게 하는 디지털 기술을 소개하고, 현업 담당자는 이를 어떻게 활용하고 적용하여야 할지를 소개하고 있습니다.* 학습 기대 효과  - 디지털 비즈니스의 특성을 통해 고객 공감이 왜, 얼마나 더 중요한지를 이해할 수 있습니다. - 고객 공감을 Enabling하는 기술들을 이해하고, 이를 적용할 수 있는 방법을 모색하고 실행을 고민해 볼 수 있습니다.* 강의 특징  - 매킨지/베인앤 컴퍼니 컨설턴트 출신, 디지털 플랫폼(위메프), AI 대표 기업(솔트룩스)의 CSO가 들려주는 고객과 디지털 이야기",
