                    "description": "mySUNI 전문교수 심승택 교수님과 함께기업들의 생존까지 위협할 수 있는 Geopolitical 불확실성에 대비, 대응하고이를 기회로 활용할 수 있는 How to, 즉, 방법론과 대안들을 파악, 이해해 봅니다Geopolitical 불확실성에 대응하기 어려운 이유, 피해를 최소화하고 복원력을 높일 수 있는공통의 Framework, 방법론, 사례 (FedEx, Intel, Nvidia, Blackrock, Cisco)와 필요 변화를 살펴 봅니다강사의 관련 경험: A. SUPEX추구협의회 글로벌성장지원팀장, SK E&S에서 Inorganic deal 리드 B. Bain & Company 파트너: 글로벌 전략, Risk 관리 등 프로젝트 리드 C. 산업부 사무관: 통상 전략 수립, 통상협상 실무 주관권장 학습 순서 (심승택 교수님)1. Why Geopolitics for Business ?2. How to manage Geopolitical Uncertainties ?",
