                    "card_name": "Why Geopolitics for Business ?",
                    "cube_state_update_date": "1589521968506",
                    "description": " “기업 구성원인 우리가 왜 Geopolitics를 알아야 하고, 관련 불확실성에 적어도 경쟁사보다는 더 잘 대비해야 하는가?”mySUNI 전문교수 심승택 교수님과 함께, 위 질문에 대한 견해를 되짚어 봅니다.Geopolitical 불확실성으로 인해 입을 수 있는 Damage와 활용할 수 있는 기회를 이해하고,이에 대비, 대응할 수 있는 대안들을 탐색하며, 그 일환으로 Intel, Disney, Blackrock, Blackstone 등 사례를 살펴 봅니다.강사의 관련 경험: A. SUPEX추구협의회 글로벌성장지원팀장, SK E&S에서 Inorganic deal 리드 B. Bain & Company 파트너: 글로벌 전략, Risk 관리 등 프로젝트 리드 C. 산업부 사무관: 통상 전략 수립, 통상협상 실무 주관권장 학습 순서 (심승택 교수님)1. Why Geopolitics for Business ?2. How to manage Geopolitical Uncertainties ?",
