                    "sub_categories_json": "[\r\n  {\r\n    \"college\": {\r\n      \"id\": \"CLG00002\",\r\n      \"name\": \"DT\"\r\n    },\r\n    \"channel\": {\r\n      \"id\": \"CHN0006o\",\r\n      \"name\": \"DT & Biz. Implementaion\"\r\n    }\r\n  }\r\n]",
                    "card_name": "[정재승 교수와 함께 하는 Tech & Biz Talk] 데이터가 만드는 새로운 제조산업",
                    "cube_state_update_date": "1600246442314",
                    "description": "라이브 중계는 9/25(금) 오후4시부터 시작됩니다! 학습신청 기한은 9/24(목) 오후 6시입니다!! (학습신청하신 분들께 접속할 링크와 접속 방법을 9/25 오전에 메일로 알려드릴 예정입니다.)알쓸신잡 정재승 교수와 함께 하는 Tech & Biz Talk! 가을의 문턱 9월에 열리는 네번째 Talk에는 장영재 KAIST 교수를 초대했습니다. mySUNI에서 8천 명 넘게 학습한 <데이터 혁신이 답이다>라는 과정을 통해 SK 구성원들과 친숙해지신 분이죠. 이번 Live 강연은 제조 영역에서 데이터를 활용하는 흐름과 제조 데이터 기반의 새로운 Biz. 기회 창출 사례를 업데이트하는 기회가 될 것입니다. 풍부한 협업 사례 소개, 이해하기 쉬운 전달, 직관의 힘이 돋보이는 장영재 교수의 강연! 논점을 향해 걸음을 좁혀 들어가는 정재승 교수의 토론! 9월 25일(금) 오후 4시부터 시작합니다!!| 주요 발표 내용 - 데이터가 바꿔가는 제조업의 정의(定義)- 제조의 디지털 혁신으로 인한 새로운 Biz.기회- 제조 디지털트윈과 IoT의 새로운 흐름- 스타트업을 활용한 제조업의 기회 창출 | 장영재 교수 주요 약력- 현 KAIST 산업 및 시스템공학과 교수- 저서 <경영학 콘서트>(비즈니스북스, 2010) - 전 마이크론 테크놀로지 프로젝트 매니저  - MIT 기계공학 박사: '불확실성을 고려한 생산 운영 방식' 관련 주제",
