                    "description": "*강의 개요-[AI Biz Insight]는 AI의 Biz 적용 관련 최신 트렌드 및 주요 사례, 스타트업 협업 사례 등을 공유하는 Micro Learning입니다.-SK 그룹 구성원들이 AI를 적용할 수 있는 업무와 적용 과정에서 발생하는 이슈에 대한 이해도를 높이고 AI 적용을 보다 효과적이고 효율적으로 추진하는데 도움을 드리고자 합니다.-이번 \"RPA를 활용한 SK텔레콤의 업무 효율화 사례\" 편에서는 SK텔레콤 Corp. AI/DT RPA팀 조지훈님께서 정형화된 반복 업무를 S/W Robot이 대신 하게 함으로써 구성원들의 업무 효율성 향상과 가치 창출 기회 증대를 위해 SK텔레콤에서 추진하고 있는 다양한 RPA 적용 사례와 경험을 공유합니다.*학습 기대 효과- 심층분석한 AI의 Biz 적용 사례를 통해 AI의 Biz 적용 기회와 이슈에 대해 이해할 수 있습니다.",
