                    "description": "코로나 바이러스로 비대면 채널을 통한 고객 응대가 증가할 것으로 예상되는 상황에서 자연어 처리가 필요한 업무의 정확성과 효율성 향상, 고객만족도 제고 방안을 고민하시는 분들께 좋은 참고가 되기를 바랍니다.*강의 개요-[AI Biz Insight]는 AI의 Biz 적용 관련 최신 트렌드 및 주요 사례, 스타트업 협업 사례 등을 공유하는 Micro Learning입니다.-SK 그룹 구성원들이 AI를 적용할 수 있는 업무와 적용 과정에서 발생하는 이슈에 대한 이해도를 높이고 AI 적용을 보다 효과적이고 효율적으로 추진하는데 도움을 드리고자 합니다.-\"딥러닝을 활용한 Sales QA 자동화\" 편에서는 SK주식회사 C&C 금융/전략 Digital 추진그룹 정재명 수석님께서 전화를 통해 보험을 청약하는 과정에 불완전판매 요소가 있는지 검수하는 Sales QA 업무에 딥러닝을 적용해 기존 방식의 문제점을 해결한 사례와 경험을 공유합니다.*학습 기대 효과- 심층분석한 AI의 Biz 적용 사례를 통해 AI의 Biz 적용 기회와 이슈에 대해 이해할 수 있습니다.-코로나 바이러스로 비대면 채널을 통한 고객 응대가 증가할 것으로 예상되는 상황에서 자연어 처리가 필요한 업무의 정확성과 효율성 향상, 고객만족도 제고 방안을 고민하시는 분들께 좋은 참고 자료가 될 수 있습니다.",
